import imag1 from "../asset/images/IMG1.png";

function Main () {

    return (
        <div className="kasa-main-banner">
            <img src={imag1} alt="banniere image de falaise"></img>
          <div className="kasa-main-titre">
            <a className="kasa-main-text">Chez vous</a> 
          </div>
            
        </div>
      );





}

export default Main
